CREATE TABLE IF NOT EXISTS Orders(
	Order_uid VARCHAR(50)UNIQUE,
	Track_number VARCHAR(50) UNIQUE,
	Entry VARCHAR(50),
	Locale VARCHAR(50),
	Internal_signature VARCHAR(50),
	Customer_id VARCHAR(50),
	Delivery_service VARCHAR(50),
	Shardkey VARCHAR(50),
	Sm_id VARCHAR(50),
	Date_created DATE,
	Oof_shard VARCHAR(50)
);
